# Write resulting states phi_i as a Bell state with a local unitary acting on one side

beta_1 = (np.kron(zero_state, zero_state) + np.kron(one_state, one_state))/np.sqrt(2)
beta_1_T = np.transpose(beta_1)
beta_2 = (np.kron(zero_state, zero_state) - np.kron(one_state, one_state))/np.sqrt(2)
beta_2_T = np.transpose(beta_2)
beta_3 = (np.kron(zero_state, one_state) + np.kron(one_state, zero_state))/np.sqrt(2)
beta_3_T = np.transpose(beta_3)
beta_4 = (np.kron(zero_state, one_state) - np.kron(one_state, zero_state))/np.sqrt(2)
beta_4_T = np.transpose(beta_4)

# The method:
# |phi> = (aI + bZ + cX + dZX) tensor 1) |b_1>
#     a = <b_1 | phi>
#     b = <b_2 | phi>
#     c = <b_3 | phi>
#     d = <b_4 | phi>

# check if it is unitary
def is_unitary(u):
    shape = np.shape(u)
    #print(np.transpose(u).dot(u))
    return np.allclose(np.transpose(u).dot(u), np.identity(shape[0]))

def case_z_to_x_basis(case_z):
    case_x = []
    for c_z in case_z:
        if c_z == 0:
            case_x.append("+")
        elif c_z == 1:
            case_x.append("-")
    return case_x

def find_unitary(num_v, faces, m, case):
    h = Hypergraph(num_v)
    h.construct_state(faces)
    h.perform_measurement(case)
    h.extract_bits(m, case)
    find_unitary_from_phi(h.h_state, case, faces)

def find_unitary_from_phi(phi, case, faces):
    a = beta_1_T.dot(phi)
    b = beta_2_T.dot(phi)
    c = beta_3_T.dot(phi)
    d = beta_4_T.dot(phi)
    output = ": U = "
    if round(a[0][0], 3) != 0:
        output = output + str(round(a[0][0], 3)) + " I"
        if round(b[0][0], 3) != 0:
            output = output + " + "
        if round(c[0][0], 3) != 0:
            output = output + " + "
        if round(d[0][0], 3) != 0:
            output = output + " + "
    if round(b[0][0], 3) != 0:
        output = output + str(round(b[0][0], 3)) + " X"
        if round(c[0][0], 3) != 0:
            output = output + " + "
        if round(d[0][0], 3) != 0:
            output = output + " + "
    if round(c[0][0], 3) != 0:
        output = output + str(round(c[0][0], 3)) + " Z"
        if round(d[0][0], 3) != 0:
            output = output + " + "
    if round(d[0][0], 3) != 0:
        output = output + str(round(d[0][0], 3)) + " XZ"
    U_1_qubit = (a * i_matrix + b * z_matrix + c * x_matrix + d * z_matrix.dot(x_matrix))
    U = np.kron(U_1_qubit, i_matrix)
    if np.allclose(phi, U.dot(beta_1)) and is_unitary(U):
        print("R = ", case_z_to_x_basis(case), output)
        return U_1_qubit
    else:
        print("R = ", case_z_to_x_basis(case), "not found")

def find_unitaries(num_v, m, face_case_list):
    for f in face_case_list:
        print("Faces: ", f)
        for c in face_case_list[f]:
            find_unitary(num_v, f, m, c)

def find_stabilizer(num_v, m, face_case_list):
    for f in face_case_list:
        print("Faces: ", f)
        for c in face_case_list[f]:
            h = Hypergraph(num_v)
            h.construct_state(f)
            h.perform_measurement(c)
            h.extract_bits(m, c)
            phi = h.h_state
            U = find_unitary_from_phi(phi, c, f)
            if U is not None:
                S_x = np.kron(U.dot(x_matrix.dot(np.transpose(U))),x_matrix)
                S_z = np.kron(U.dot(z_matrix.dot(np.transpose(U))), z_matrix)
